import "./../styles/App.scss";

interface IMenuItemsProps {
  item: any;
}

function MenuItems({ item }: IMenuItemsProps) {
  console.log(item);
  const [menuElement, setMenuElement] = useState<any>();

  const { title } = item.element;

  return (
    <div className="menu-items-container">
      <div className="menu-button" onMouseEnter={() => setShowMenuItem(true)}>
        <h2>{title}</h2>
      </div>
      <div
        className="menu-content"
        style={{ backgroundColor: "red", width: 200, height: 200 }}
      ></div>
    </div>
  );
}

export default MenuItems;
